import React from 'react';

const BestFeatures = () => {
    return (
        <section style={styles.container}>
            <h2 style={styles.title}>Почему мы лучшие</h2>
            <div style={styles.box}>
                <p style={styles.text}>
                    Мы - лидер на рынке бытовой техники, потому что предлагаем не только широкий ассортимент товаров, но и высокий уровень сервиса.
                    Наша компания предлагает конкурентоспособные цены, быструю доставку и гарантию на все товары. Мы постоянно следим за новыми трендами в сфере технологий и
                    стремимся предоставлять нашим клиентам только самые лучшие и современные продукты.
                </p>
                <ul style={styles.list}>
                    <li style={styles.listItem}>• Широкий ассортимент</li>
                    <li style={styles.listItem}>• Отличные цены</li>
                    <li style={styles.listItem}>• Быстрая доставка</li>
                    <li style={styles.listItem}>• Профессиональная поддержка</li>
                    <li style={styles.listItem}>• Гарантия качества</li>
                </ul>
            </div>
        </section>
    );
};

const styles = {
    container: {
        padding: '40px 20px',
        backgroundColor: '#f9f9f9',
        textAlign: 'center',
    },
    title: {
        fontSize: '32px',
        fontWeight: 'bold',
        marginBottom: '20px',
    },
    box: {
        backgroundColor: '#fff',
        border: '1px solid #ddd',
        borderRadius: '8px',
        padding: '20px',
        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
        textAlign: 'left',
        margin: '0 auto',
        width: '80%',
        maxWidth: '900px',
    },
    text: {
        fontSize: '18px',
        color: '#333',
        marginBottom: '20px',
    },
    list: {
        listStyle: 'none',
        padding: 0,
    },
    listItem: {
        fontSize: '16px',
        color: '#555',
        marginBottom: '10px',
    },
};

export default BestFeatures;
